import React from "react";
import "./HomeBlurb.css";

export default function HomeBlurb() {
    return (
        <p id="HomeBlurb">
            <span className="text-big">Hi!</span>
            My Name is <span className="big-red">Andy Hopwood</span>. I make Websites, Software and 
            Business Automation.
        </p>
    );
}
